import React from "react";
import "./App.css";
import ListItem from "./SimpleComponents/ListItem";
import moment from "moment";
function App() {
  const nameList = [
    {
      name: {
        title: "Mr",
        first: "Brad",
        last: "Gibson",
      },
      location: {
        city: "kilcoole",
      },
      email: "brad.gibson@example.com",
      dob: {
        date: "1993-07-20T09:44:18.674Z",
      },
      picture: {
        medium: "https://randomuser.me/api/portraits/men/75.jpg",
      },
    },
    {
      name: {
        title: "Mrs",
        first: "Brie",
        last: "Larson",
      },
      location: {
        city: "New York",
      },
      email: "brie.larson@example.com",
      dob: {
        date: "1990-08-23T01:14:28.374Z",
      },
      picture: {
        medium: "https://randomuser.me/api/portraits/women/3.jpg",
      },
    },
  ];

  const i = 0;
  const j = 1;
  // for (i = 0; i < cars.length; i++) {
  //   <ListItem
  //     name = {`${nameList[i].name.title} ${nameList[i].name.first} ${nameList[i].name.last}`}
  //     city = {nameList[i].location.city}
  //     email = {nameList[i].email}
  //     birthday = {moment(nameList[i].dob.date).format('L')}
  //     avatar = {nameList[i].picture.medium}
  //   />
  // }

  return (
    <React.Fragment>
      <h1 className="Title">The Card List</h1>
      <p className="page">
        <ListItem
          name={`${nameList[i].name.title} ${nameList[i].name.first} ${nameList[i].name.last}`}
          city={nameList[i].location.city}
          email={nameList[i].email}
          birthday={moment(nameList[i].dob.date).format("L")}
          avatar={nameList[i].picture.medium}
        />
        <ListItem
          name={`${nameList[j].name.title} ${nameList[j].name.first} ${nameList[j].name.last}`}
          city={nameList[j].location.city}
          email={nameList[j].email}
          birthday={moment(nameList[j].dob.date).format("L")}
          avatar={nameList[j].picture.medium}
        />
      </p>
    </React.Fragment>
  );
}

export default App;
